dif]--> <!--StartFragment--> Please look at the IRS notice and your tax return to see why this tax amount may be due. Does the IRS claim that you owe money to them because <strong style=\"mso-bidi-font-weight: normal;\">of <u>any of the following:</u></strong></p>\r\n<p>&nbsp;</p>\r\n<p><!-- [if !supportLists]--><span style=\"mso-list: Ignore;\">a.<span style=\"font: 7.0pt 'Times New Roman';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]-->You and you spouse understated income in your tax return? For example, you and your spouse earned money in that year and failed to report it on the tax return, <strong style=\"mso-bidi-font-weight: normal;\"><u>or</u></strong></p>\r\n<p><span style=\"mso-list: Ignore;\">b.<span style=\"font: 7.0pt 'Times New Roman';\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]-->You and your spouse included items to deduct from your income that did not exist or exaggerated these amounts? Common examples of deductions include interest paid on a mortgage, real estate taxes paid, or charitable donations, <strong style=\"mso-bidi-font-weight: normal;\"><u>or</u></strong></p>\r\n<p>c.<span style=\"font-stretch: normal; font-size: 7pt; font-family: 'Times New Roman';\">&nbsp;&nbsp;&nbsp;&nbsp; </span>The tax return is correct but you are not currently able to pay the tax due or feel it would be unfair for you to pay the tax rather than your spouse? For example, your spouse does not contribute to pay family expenses or the tax that you owe is due to your spouse not withholding enough from their income.</p>\r\n<p>&nbsp;</p>", yes_response: "8", no_response: "faq", prequalifier: nil},
